import { Grid } from "@mui/material";
import { useState, useEffect } from "react";
import Pages from "./components/Pages";
import { Routes, Route } from 'react-router-dom'
import view from "./components/view";

function App() {
  const [data, setData] = useState([]);
  //getting posts
  useEffect(() => {
    const paginationFunc = async () => {
      const res = await fetch("https://newsapi.org/v2/top-headlines?country=us&category=business&apiKey=8b1415110de2471d92d95f97d5c63760");
      const data = await res.json();
      setData(data.articles);
      console.log(data.articles);
    };
    paginationFunc();
  }, []);
  return (
    <>
    <Routes>
      <Route exact path="/book" element={<view/>}/>
      {/* <Route path="/book/:author" element={<bookdetails/>}/> */}

    </Routes>
    {data && data.length > 0 ? 
      <Grid container xs={4}>
    <Pages data={data} />
     </Grid>
    : <p>Loading...</p>}
    </>
  );
}

export default App;
